import React, { Component } from 'react';
import { Card } from 'react-bootstrap';
import bivakzones from '../bivakzones.json';




export default class WcList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            type: [],
            bicycle: true
        };
    }

    componentDidMount() {
        fetch('http://localhost:3001/water', { headers: { 'Content-Type': 'bivakzones/json' } })
            .then(r => r.json())
            .then(type => {
                this.setState({ type, bicycle: false });
            });
    }


    render() {
        return (
            <div>
                <Card>

                    <Card.Body>
                        <Card.Title></Card.Title>
                        <Card.Text>
                            <ul>

                                <li type={type}>openfire:</li>

                            </ul>
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
        )
    }
}
